import React from "react";
import first from './images/tall-building.jpg';
import second  from './images/waterfall.jpg';
import third from './images/underground-aquarium.jpg'
export default function Footer() {
    return (
        <footer>
            <img src={first} className='footer-img' alt="footer image"/>
            <img src={second}/>
            <img src={third}/>
        </footer>
    );
}
